script: |
  super -f text -I q11545.spq | sort > q11545.out

inputs:
  - name: q11545.spq
    data: |
      SELECT - col0 FROM tab1 (FORMAT parquet) WHERE NOT col0 IN ( - col1 * col2 + - + col1, - col0 / - - col0, + 16 );
  - name: tab1

outputs:
  - name: q11545.out
    data: |
      -51
      -85
      -91
